const zkPassport = new ZKPassport('http://localhost')

//TODO to finish
task("e2e:enable", "Run enable module flow against Sepolia for a 1/x Safe")
  .addParam("safe", "Safe address")
  .addParam("module", "Address of the ZKModule")
  .addParam("pk", "signer PK")
  .setAction(async ({ safe, module, pk }, hre) => {

    const protocolKit = await Safe.init({
      provider: process.env.SEPOLIA_URL!,
      signer: pk,
      safeAddress: safe,
    })

    const enableTransaction = await protocolKit.createEnableModuleTx(module);

    const signedTransaction = await protocolKit.signTransaction(enableTransaction)
    const tx = await protocolKit.executeTransaction(signedTransaction)

    //@ts-ignore-next-line
    const receipt = await publicClient.waitForTransactionReceipt({ hash: tx.hash })

    console.log("register tx:", receipt.transactionHash)
    console.log(receipt)
  })

task("e2e:registerGuardian", "Run register guardian flow against Sepolia for a 1/x Safe")
  .addParam("safe", "Safe address")
  .addParam("module", "Address of the ZKModule")
  .addParam("pk", "signer PK")
  .setAction(async ({ safe, module, pk }, hre) => {
    const protocolKit = await Safe.init({
      provider: process.env.SEPOLIA_URL!,
      signer: pk,
      safeAddress: safe,
    })


    const SolidityProof = zkPassport.getSolidityVerifierParameters({
      proof: mockedZkParamRegister,
      devMode: false,
      domain: "localhost",
    })

    const registerGuardianTransaction =
    {
      //@ts-ignore-next-line
      to: module,
      data: encodeFunctionData({
        abi: moduleAbi,
        functionName: "register",
        //@ts-ignore-next-line
        args: [SolidityProof]
      }),
      value: '0'
    }

    const safeTransaction = await protocolKit.createTransaction({ transactions: [registerGuardianTransaction], options: { baseGas: "10000000" } })
    const signedTransaction = await protocolKit.signTransaction(safeTransaction)
    const tx = await protocolKit.executeTransaction(signedTransaction, { gasLimit: 10000000 })

    //@ts-ignore-next-line
    const receipt = await publicClient.waitForTransactionReceipt({ hash: tx.hash })

    console.log("register tx:", receipt.transactionHash)
    console.log(receipt)
  })

